import { Component, OnInit } from '@angular/core';

@Component({
  selector: 'app-notfound',
  templateUrl: './notfound.page.html',
  styleUrls: ['./notfound.page.scss'],
})
export class NotfoundPage implements OnInit {

  constructor() { }

  ngOnInit() {
  }

}
<ion-header [translucent]="true">
  <ion-toolbar>
    <ion-title #animar1>Error 404</ion-title>
  </ion-toolbar>
</ion-header>

<ion-content [fullscreen]="true">
  <ion-card>
    <img alt="Silhouette of mountains" src="https://i.pinimg.com/originals/19/93/c3/1993c392d24666e1d18fe842d7eb666b.jpg" />
  </ion-card>

  <h1>Página NO encontrada</h1>

  <h2>Por favor, intente nuevamente</h2>
</ion-content>
